// src/components/PastPapers.js
import React from 'react';
import { Box, Typography, Button } from '@mui/material';


const Notes = () => {
  return (
    <Box
      sx={{
        flexGrow: 1,
        p: 3,
        minHeight: '100vh',
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        justifyContent: 'center',
        backgroundColor: '#2c2c2c',
        backgroundImage: `url(${logo})`,
        backgroundSize: 'cover',
        backgroundPosition: 'center',
        backgroundAttachment: 'fixed',
        backgroundBlendMode: 'overlay',
        filter: 'blur(8px)', // Applies a blur to the background logo
        position: 'relative',
      }}
    >
      {/* Background overlay */}
      <Box
        sx={{
          position: 'absolute',
          top: 0,
          left: 0,
          right: 0,
          bottom: 0,
          backgroundColor: 'rgba(44, 44, 44, 0.8)', // Dark overlay with transparency
          zIndex: -1, // Keep it behind the content
        }}
      />
      <Typography variant="h4" gutterBottom>
        Past Papers
      </Typography>
      <Typography variant="body1" sx={{ mb: 2 }}>
        Access past exam papers for better preparation.
      </Typography>
      <Button variant="contained" color="primary">
        View Past Papers
      </Button>
    </Box>
  );
};

export default PastPapers;
